using MvvmHelpers;
using System;
using System.Collections.Generic;
using System.Text;

namespace HA.ViewModels
{
   public class MyRecentAppViewModel:BaseViewModel
    {
        public MyRecentAppViewModel()
        {
            GetData();
        }
        string _photoUrl,_name;

        public string PhotoUrl
        {
            get { return _photoUrl; }
            set { _photoUrl = value;OnPropertyChanged(); }
        }
        public string Name
        {
            get { return _name; }
            set { _name = value; OnPropertyChanged(); }
        }
        private List<UserDemo> _user;

        public List<UserDemo> Users
        {
            get { return _user; }
            set { _user = value;OnPropertyChanged(); }
        }

        void GetData()
        {
            Users = new List<UserDemo>
            {
                new UserDemo{Name="Name1",PhotoUrl="data:image/jpeg;base64,"},
new UserDemo{Name="Name2",PhotoUrl="data:image/jpeg;base64,"},
new UserDemo{Name="Name3",PhotoUrl="data:image/jpeg;base64,"}
            };
        }
    }
    public class UserDemo
    {
        public string PhotoUrl { get; set; }
        public string Name { get; set; }
    }
}
